import{_ as a,c as t,o as l,U as i}from"./chunks/framework.K-r7inPk.js";const w=JSON.parse('{"title":"iOS调试工具的使用","description":"","frontmatter":{"title":"iOS调试工具的使用","date":"2020-06-11T10:59:59.000Z"},"headers":[],"relativePath":"doc/wpdoc/iOS调试工具的使用.md","filePath":"doc/wpdoc/iOS调试工具的使用.md"}'),o={name:"doc/wpdoc/iOS调试工具的使用.md"},p=i('<h1 id="ios调试工具的使用" tabindex="-1">iOS调试工具的使用 <a class="header-anchor" href="#ios调试工具的使用" aria-label="Permalink to &quot;iOS调试工具的使用&quot;">​</a></h1><h3 id="一、功能概况" tabindex="-1">一、功能概况 <a class="header-anchor" href="#一、功能概况" aria-label="Permalink to &quot;一、功能概况&quot;">​</a></h3><h5 id="_1-刷新表单和查看页面传参" tabindex="-1">1.刷新表单和查看页面传参 <a class="header-anchor" href="#_1-刷新表单和查看页面传参" aria-label="Permalink to &quot;1.刷新表单和查看页面传参&quot;">​</a></h5><h5 id="_2-查看网络请求的数据" tabindex="-1">2.查看网络请求的数据 <a class="header-anchor" href="#_2-查看网络请求的数据" aria-label="Permalink to &quot;2.查看网络请求的数据&quot;">​</a></h5><h5 id="_3-查看手机本地的数据库" tabindex="-1">3.查看手机本地的数据库 <a class="header-anchor" href="#_3-查看手机本地的数据库" aria-label="Permalink to &quot;3.查看手机本地的数据库&quot;">​</a></h5><h5 id="_4-查看手机的其他信息" tabindex="-1">4.查看手机的其他信息 <a class="header-anchor" href="#_4-查看手机的其他信息" aria-label="Permalink to &quot;4.查看手机的其他信息&quot;">​</a></h5><h3 id="二、开关设置" tabindex="-1">二、开关设置 <a class="header-anchor" href="#二、开关设置" aria-label="Permalink to &quot;二、开关设置&quot;">​</a></h3><p>侧边栏-&gt;开发设置-&gt;开发模式，打开&quot;开启&quot;开关即可</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/setting1.png" alt=""> <img src="http://apaas.wxchina.com:8881/wp-content/uploads/setting2.png" alt=""></p><h3 id="三、flex工具说明" tabindex="-1">三、FLEX工具说明 <a class="header-anchor" href="#三、flex工具说明" aria-label="Permalink to &quot;三、FLEX工具说明&quot;">​</a></h3><ul><li><p>FLEX工具是一个app引入的辅助调试工具库，里面包含了很多功能，比如：查看网络请求，文件浏览等等</p></li><li><p>工具的启动通过手机摇一摇，可以唤出此功能，menu里包含了众多实用功能，下面会做介绍。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/FLEX1.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/FLEX2.png" alt=""></p></li></ul><h3 id="四、工具使用举例" tabindex="-1">四、工具使用举例 <a class="header-anchor" href="#四、工具使用举例" aria-label="Permalink to &quot;四、工具使用举例&quot;">​</a></h3><h4 id="_1-刷新表单" tabindex="-1">1.刷新表单 <a class="header-anchor" href="#_1-刷新表单" aria-label="Permalink to &quot;1.刷新表单&quot;">​</a></h4><ul><li><p>说明：</p><ul><li>IDE修改表单后，手机单不会立即生效，需要清除缓存或者在这里刷新表单才能生效。</li><li>刷新表单会重新加载表单，执行表单的所有行为，与从上个页面跳到本界面的效果相同。</li></ul></li><li><p>操作步骤：</p><ul><li>点击页面左上角的书形图标，选择“刷新表单”即可。</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/refreshPage1.png" alt=""></p></li></ul><h4 id="_2-查看页面传参" tabindex="-1">2.查看页面传参 <a class="header-anchor" href="#_2-查看页面传参" aria-label="Permalink to &quot;2.查看页面传参&quot;">​</a></h4><ul><li><p>说明：</p><ul><li>可以查看上个页面传到本页面的参数和具体的值。</li></ul></li><li><p>操作步骤：</p><ul><li>点击页面左上角的书形图标，选择“查看传参”，即可弹出查看参数的页面，点击页面的半透明处，退出查看参数页面。</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/watchParam1.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/watchParam2.png" alt=""></p></li></ul><h4 id="_3-查看网络请求数据" tabindex="-1">3.查看网络请求数据 <a class="header-anchor" href="#_3-查看网络请求数据" aria-label="Permalink to &quot;3.查看网络请求数据&quot;">​</a></h4><ul><li><p>说明：</p><ul><li>可详细查看app的网络请求数据</li><li>操作步骤：</li><li>手机摇一摇，唤出FLEX工具(参见第三部分)，然后点击“menu”，进入FLEX工具页面，点击“Network History”即可进入网络请求的列表界面。</li><li>网络请求列表列表的是按照时间顺序排列的，最上面为最近的一次网络请求，点击你需要查看的网络请求，可以查看网络请求的详细信息</li><li>其中点击“Request Body”和“Response Body”可以分别查看网络请求的入参和出参的详细信息，这里一般是我们关注的比较多的地方。</li><li>页面还有网络请求的其他相关信息，这里不再一一说明。</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/network1.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/network2.png" alt=""></p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/network3.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/network4.png" alt=""></p><ul><li>Network的setting界面可以设置网络请求缓存大小，清除记录等操作。</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/network5.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/network6.png" alt=""></p></li></ul><h4 id="_4-查看本地数据库" tabindex="-1">4.查看本地数据库 <a class="header-anchor" href="#_4-查看本地数据库" aria-label="Permalink to &quot;4.查看本地数据库&quot;">​</a></h4><ul><li><p>说明：</p><ul><li>可详细查看存在手机本地的数据库的信息</li><li>操作步骤：</li><li>手机摇一摇，唤出FLEX工具(参见第三部分)，然后点击“menu”，进入FLEX工具页面，点击“File Browser”即可进入手机app的沙盒文件的列表界面。</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/db1.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/db2.png" alt=""></p><ul><li>点击&quot;Documents&quot;，再点击 &quot;公有云&quot;(此处根据自己登录的帐号不同而不同)</li><li>此目录下可以看到用户的帐号信息数据库“UserInfo.db”, 在里面的userinfo表中找到&quot;accountcode&quot;和 &quot;lastposition&quot;字段的值</li><li>在“公有云”页面找到以&quot;accountcode&quot;的值(如图中的“1151024358332960768”)命名的文件夹，点击进入</li><li>在新界面中找到以“lastposition”的值(如图中的“1156469236332367872”)为结尾的文件夹，点击进入，这里才是app目前登录的帐号对应文件夹，其中BizDataBase.db数据库中存放着app的这种主要信息。</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/db3.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/db4.png" alt=""></p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/db5.png" alt=""><img src="http://apaas.wxchina.com:8881/wp-content/uploads/db6.png" alt=""></p></li></ul><h4 id="_5-查看手机的其他信息" tabindex="-1">5.查看手机的其他信息 <a class="header-anchor" href="#_5-查看手机的其他信息" aria-label="Permalink to &quot;5.查看手机的其他信息&quot;">​</a></h4><ul><li><p>说明：</p><ul><li>我们还可以通过FLEX工具查看app所下载的表单json信息，拍摄的照片信息等。</li></ul></li><li><p>操作步骤：</p><ul><li>首先按照 查看本地数据库 的步骤找到当前登录帐号对应的文件夹</li><li>其中&quot;Pages&quot;目录下存放的是app下载的表单json信息</li><li>&quot;Files&quot;目录存放有拍照控件拍摄的照片的大图等信息，&quot;Thumbs&quot;目录存放的是拍照控件拍摄的缩略图信息</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/db8.png" alt=""></p></li></ul>',22),e=[p];function n(c,s,r,h,u,d){return l(),t("div",null,e)}const _=a(o,[["render",n]]);export{w as __pageData,_ as default};
